import React, { ChangeEvent, useState } from "react";
import "./home.css";
import ShuffleIcon from "../../components/Icons/ShuffleIcon";
import ForwardIcon from "../../components/Icons/ForwardIcon";
import BackwardIcon from "../../components/Icons/BackwardIcon";
import PlayIcon from "../../components/Icons/PlayIcon";
import LoopIcon from "../../components/Icons/LoopIcon";
import SpeakerLow from "../../components/Icons/VolumeLow";
import VolumeMedium from "../../components/Icons/VolumeMedium";
import VolumeHighIcon from "../../components/Icons/VolumeHigh";
import VolumeLow from "../../components/Icons/VolumeLow";
import VolumeOff from "../../components/Icons/VolumeOff";

const Home = () => {
  const [volume, setVolume] = useState<number>(0);

  return (
    <>
      <div className="main">
        <div className="div1"></div>
        <div className="div2"></div>
      </div>
      <div className="div3">
        <div>
          {" "}
          <ShuffleIcon color="white" size={20} />
          <BackwardIcon color="white" size={20} />
        </div>
        <div>
          <div className="NavigatorIcons">
            {/* <ShuffleIcon color="#117a37" size={20} /> */}
            <ShuffleIcon color="white" size={20} />
            <BackwardIcon color="white" size={20} />
            <PlayIcon color="white" size={20} />
            <ForwardIcon color="white" size={20} />
            <LoopIcon color="white" size={20} />
          </div>
          <div></div>
        </div>
        <div className="flex" style={{ gap: "15px" }}>
          <label>
            if ({volume===0}) {
              <VolumeOff color="white" size={15} />
            }
          </label>

          <VolumeOff color="white" size={15} />
          <VolumeLow color="white" size={20} />
          <VolumeMedium color="white" size={30} />
          <VolumeHighIcon color="white" size={25} />
          <input type="range" min="0" value={volume} max="100" step="10" />
        </div>{" "}
      </div>
    </>
  );
};
export default Home;
